import React, {useState,useEffect} from 'react';
import AgentsCard from 'AgentsCard'

const Agents = () => {
    const [agents, setAgents] = useState([])

    useEffect(() => {
        fetch("http://localhost:3001/employees")
        .then((response) => response.json())
        .then((data) => {
          console.log(data);
          setAgents(data);
      });
    }, []);

  return (
        <ul classNmae = "cards">
            {agents.map((agent) =>{
                return <
                    AgentsCard
                    key= {agent.name}
                    agent={ agent}
                />
            })}
        </ul>
    );
}

export default Agents;
